Fremde, Die (2010) 
Alternatieve titel: When We Leave 

Duitsland
Drama
119 minuten

geregisseerd door Feo Aladag
met Sibel Kekilli, Nizam Schiller en Derya Alabora

25-jarige Umay staat met haar kleine zoontje opeens voor de deur van haar ouders in Berlijn. Ze is weer teruggekeerd na een ongelukkig huwelijk in Istanbul. Umays ouders en de rest van de familie zijn niet bepaald gelukkig met haar wens een eigen onafhankelijk leven te gaan leiden in Berlijn. Umay hoopt echter dat hun liefde voor haar het uiteindelijk zal winnen van de maatschappelijke dwang en culturele conventies. Maar wanneer de familie besluit haar zoontje naar vader in Istanbul te sturen is voor Umay de maat vol.



